export const SchemaTypes = {
  string: "string",
  number: "number",
  boolean: "boolean",
};

const validateData = (schema, data) => {
  Object.keys(data).map((key) => {
    const type = schema[key];

    if (typeof data[key] !== type) {
    }
  });
};
